$(function(){

    var r = Raphael('map', 700, 700),
        attributes = {
            fill: '#fff',
            stroke: '#C2C2C2',
            'stroke-width': 1,
            'stroke-linejoin': 'round',
			activefill: "#f0f0f0"
        },
        arr = new Array();
		
		var tfm = 'S1.34,1.34,0,0';
		
    for (var country in paths) {

        var obj = r.path(paths[country].path);

        obj.attr(attributes);

        arr[obj.id] = country;
		
		obj.transform(tfm);
		
		obj.attr({
			
		})
		
		if (paths[arr[obj.id]].href) {	
			obj.attr({
				fill: attributes.activefill,
				href: paths[arr[obj.id]].href
			})
		}

        obj
            .hover(function(){
				this.toFront()
                this.animate({
                    fill: '#ffeded',
					stroke:'#c17978'
                }, 200);

                var point = this.getBBox(0);

                $('#map').next('.point').remove();

                $('#map').after($('<div />').addClass('point'));

                $('.point')
                    .html(paths[arr[this.id]].name)
                    .css({
                        left: point.x+(point.width/3),
                        top: point.y-300
                    })
                    .fadeIn();

            }, function(){
				if (paths[arr[this.id]].href) {	
					this.animate({
						fill: attributes.activefill,
						stroke: attributes.stroke
					}, 200);
				}
				else {
					this.animate({
						fill: attributes.fill,
						stroke: attributes.stroke
					}, 200);
				}
                $('.point').fadeOut(200)
                $('.point').remove()
            })

    }

});
